import React from "react";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";

class PortfolioWebsite extends React.Component {


  render() {
    return (

        <div className="project">
        <h3 className="subheading">Personal Portfolio Website</h3>
        <br />
        <div className="projectButtons">
          <button
            className="projectButton"
            onClick={() =>
              window.open(
                "https://github.com/StephenDoyle10/stephendoyle10.github.io"
              )
            }
          >
            View Code
          </button>
        </div>
        <br />
        <br />
        <p>
          This is the website you are viewing right now! Created from
          scratch, and built with HTML, CSS and JavaScript, with a
          little help from my friends Bootstrap and Sass.
          <br />
        </p>
        <br />
      </div>

    );
  }
}

export default PortfolioWebsite;
